var NeusoftMob=(function(){window.MOB=window.MOB||{};MOB.utils={isWX:function(){var b=window.navigator.userAgent.toLowerCase();if(b.match(/MicroMessenger/i)=="micromessenger"){return true}return false},isApp:function(){var b=window.navigator.userAgent.toLowerCase();if(b.match(/Neusoft/i)=="neusoft"){return true}return false},getOS:function(){var b=window.navigator.userAgent.toLowerCase();if(b.match(/Neusoft/i)!="neusoft"){console.log("运行环境：未在客户端内执行！")}if(b.match(/iPhone/i)=="iphone"||b.match(/iPad/i)=="ipad"){return 1}else{if(b.match(/Android/i)=="android"){return 2}else{if(b.match(/Windows/i=="windows")||b.match(/Linux/i=="linux")||b.match(/Macintosh/i=="macintosh")){return 3}}}},isDeviceMotion:function(){if(window.DeviceMotionEvent){return true}console.log("运行环境：本设备不支持devicemotion事件");return false},getUrlParam:function(c){var b=window.location.search.substr(1);var d=new RegExp("(^|&)"+c+"=([^&]*)(&|$)");var e=b.match(d);if(e!=null){return decodeURI(e[2])}return null}};var a=function(){if(window.WebViewJavascriptBridge){callback(WebViewJavascriptBridge)}else{document.addEventListener("WebViewJavascriptBridgeReady",function(){callback(WebViewJavascriptBridge)},false)}};a.prototype={shareWXMoments:function(b){switch(MOB.utils.getOS()){case 1:window.WebViewJavascriptBridge.callHandler("shareWXMoments",JSON.stringify(b),function(c){});break;case 2:window.bridge.shareWXMoments(JSON.stringify(b));break;default:console.log("分享朋友圈：不支持的终端类型！");break}},share:function(b){switch(MOB.utils.getOS()){case 1:window.WebViewJavascriptBridge.callHandler("share",JSON.stringify(b),function(c){});break;case 2:window.bridge.share(JSON.stringify(b));break;default:console.log("分享：不支持的终端类型！");break}},shake:function(){switch(MOB.utils.getOS()){case 1:window.WebViewJavascriptBridge.callHandler("shake","",function(b){});break;case 2:window.bridge.shake();break;default:console.log("摇一摇反馈：不支持的终端类型！");break}}};return a})();